import React from 'react';

const SearchBox = () => {
	return(
		<div className='pa2'>
		<input
		className='pa3 ba b--green bg-lightest-blue shadow-5 dim'
		type='search' 
		placeholder='Enter the name of your Robo'
		/>
		</div>
		);
}
export default SearchBox;
